import axios from 'axios'

axios.defaults.withCredentials = true;

const API_URL = 'http://localhost:8000'

class MemberList {
    member(){
        return axios
        .get(API_URL + 'member/',)
        .then(response => {
            return response.data
        })
    }
}

export default new MemberList();
